import React from 'react'

class GalleryItem extends React.Component {
    constructor(props) {
        super(props);
    }
    componentDidMount() {
        this.state = {
            element: JSON.parse(JSON.stringify(this.props.element))
        }
        console.log(this.state.element)
    }
    render() {
        return (
            this.state.element
        )
    }
}

export default GalleryItem;
